import { Injectable, InjectionToken, Injector } from '@angular/core';
import { Observable } from 'rxjs';
import { CONTENT_TYPE, PlHttpService } from './pl-http.service';
import { HttpHeaders } from '@angular/common/http';
declare const window: any;

/**
 * @ignore
 */
const template =
  '<div style="  margin-top: 5%; text-align: center; color: blue;  ">                                  ' +
  '  <div>                                                                                             ' +
  '    <img src="#ico" style=" width: 100px " />                                                       ' +
  '    <h3  >Ooooops !!!</h3>                                                                          ' +
  '  </div>                                                                                            ' +
  '  <h4  >Il tuo browser #0 sembra non essere al momento compatibile</h4>' +
  '  <h4  >Si raccomanda di utilizzare un altro browser</h4>                                           ' +
  ' </div>                                                                                             ';



/**
 * @author l.piciollo
 * Mappa dei browser name
 */
export enum BROWSER {
  EDGE = "edge",
  OPERA = "opera",
  CHROME = "chrome",
  IE = "ie",
  FIREFOX = "firefox",
  SAFARI = "safari",
  OTHER = "other",
  ALL = "all"
}

/**
 * @author l.piciollo
 * token per identificare quali browser sono supportati 
 * @example { provide: BROWSER_VALID, useValue: [BROWSER.ALL] }
 */
export const BROWSER_VALID = new InjectionToken<Array<BROWSER>>('browser validi');
/**
* @author l.piciollo
* token per identificare se disabilitare o meno la console.log, valido in un contesto produzione
* @example { provide: DISABLE_LOG, useValue: true }
*/
export const DISABLE_LOG = new InjectionToken<Array<boolean>>('disabilita log');


/**
 * @author l.piciollo
 * classe per identificare e settare alcune funzionalita in base al browser o a delle preferenze
 * è posibile bloccare diversi tipi di browser o disabilitare i log tramite l'inizializazione dei 
 * token BROWSER_VALID e DISABLE_LOG
 * invocando all'inizializzazione del sistema, il medoto detect.. è possibile agganciare nuove funzionalità
 * al browser.. come nuove routin per gli array o per la conversione di di JSON basta impostare
 * { provide: APP_INITIALIZER, useFactory: AmbientModeProviderFactory, deps: [PlAmbientModeLoaderService ], multi: true }
 */
@Injectable({
  providedIn: 'root'
})
export class PlAmbientModeLoaderService {
  /**
   * @ignore
   * 
   */
  private mapIcons = Object.freeze({
    chrome: "data:image/png;base64,",
    edge: "data:image/png;base64,",
    opera: "data:image/png;base64,",
    ie: "data:image/png;base64,",
    firefox: "data:image/png;base64,",
    safari: "data:image/png;base64,"
  });



  /**
   * @ignore
   * @param httpService 
   * @param injector 
   */
  constructor(private httpService: PlHttpService, public injector: Injector) {
    if (this.injector.get(BROWSER_VALID).indexOf(BROWSER.ALL) < 0) {
      if (this.injector.get(BROWSER_VALID).indexOf(this.browserIdentify()) < 0) {
        document.body.innerHTML = (this.htmlToElement(template, this.browserIdentify()));
        throw new Error("*** Browser not supported for this application ***")
      }
    }
    if (this.injector.get(DISABLE_LOG)) {
      this.disableConsole();
    }
  }

  /**
   * @author l.piciollo
   * inizializzazione della fase di autenticazione del browser e innesco delle funzionlaità aggiuntive
   */
  detect(): Observable<any> {
    return new Observable<any>(observer => {
      try {
        this.extendsFunction();
        this.downloadFileOver();
        observer.next(window.navigator.userAgent);
      } catch (error) {
        observer.error(error);
      } finally {
        observer.complete();
      }
    });
  }

  /*********************************************************************************************************/
  /**
   * @ignore
   * @param html 
   * @param browser 
   */
  private htmlToElement(html, browser) {
    try {
      return html.replace("#0", browser).replace("#ico", this.mapIcons[browser]);
    } catch (e) {
      throw e
    }
  }
  /*********************************************************************************************************/
  /**@ignore */
  private extendsFunction() {
    // console.debug("*** add new extension function ***");
    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array  
    * si occupa di spostare un elemento di un array in una posizione precedente
    * @param from : indice dell'array per muovere il contenuto in una posizione precedente
    */
    // tslint:disable-block
    (<any>Array.prototype).moveDown = function (from): void {
      if (from > 0 && from + 1 < this.length)
        this.splice(from + 1, 0, this.splice(from, 1)[0]);
    };

    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array  
    * si occupa di sposrare un elemento da una posizione ad un altra
    * @param from : indica la cella da muovere
    * @param to : indica l'indice della cella destinataria
    */
    // tslint:disable-block
    (<any>Array.prototype).moveTo = function (from, to): void {
      if (to > -1 && to < this.length + 1)
        this.splice(to, 0, this.splice(from, 1)[0]);
    };

    /**
    * @author l.piciollo 
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array 
    * si occupa di spostare in avanti di una posizione un elemento dell'array 
    * @param from : indice dell'array per muovere il contenuto in una posizione successiva
    */
    // tslint:disable-block
    (<any>Array.prototype).moveUp = function (from): void {
      if (from - 1 > -1)
        this.splice(from - 1, 0, this.splice(from, 1)[0]);
    };

    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array . 
    * si occupa di eliminare un elemento da un array in una determinata posizione
    * @param from : indice dell'array per muovere il contenuto in una posizione precedente
    */
    // tslint:disable-block
    (<any>Array.prototype).delete = function (position): void {
      if (position > -1 && position < this.length + 1) this.splice(position, 1);
    };

    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array  
    * si occupa di inserire un elemento in una determinata posizione
    * @param index : indica la cella da muovere
    * @param item : indica l'indice della cella destinataria
    */
    // tslint:disable-block
    (<any>Array.prototype).insert = function (index, item): void {
      this.splice(index, 0, item);
    };

    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array  
    * si occupa di ritornare solo gli elementi che non sono presenti nella lista in input
    * @param items : array di elementi da confrontare     
    * @returns ritorna l'array con i soli item che non non presenti in entrambe le liste.
    */
    // tslint:disable-block
    (<any>Array.prototype).differences = function (items): any {
      return this.filter((element => {
        return items.indexOf(element) < 0;
      }));
    };

    /**
    * @author l.piciollo
    * estenzione dell'array nativo per l'aggiunta di funzionalita per lo spostamento degli
    * elementi in un array  
    * si occupa di verificare se un elemento è presente o meno nell'array
    * @param item : elemento da controllare   
    * @returns ritorna il numero di indice array in cui è presente l'elemento
    */
    // tslint:disable-block
    (<any>Array.prototype).inArray = function (item): Number {
      for (var i = 0; i < this.length; i++) {
        if (item == this[i]) return i;
      }
      return -1;
    };

    /**
    * @author l.piciollo
    * estenzione delle string native per l'aggiunta di nuove funzionalità
    * si occupa di formattare una stringa, aggiungendo dei parametri nelle rispettive posizioni
    * @example "HELLO {0} {1}".format("TO", "ALL") 
    * @returns il risultato finale sarà "HELLO TO ALL"
    */
    // tslint:disable-block
    (<any>String.prototype).format = function (...params): string {
      let a = this;
      for (let k in params) {
        a = a.replace("{" + k + "}", params[k])
      }
      return a
    };

    /**
    * @author l.piciollo
    * estenzione delle string native per l'aggiunta di nuove funzionalità
    * si occupa di controllare se una stringa è nulla o blanck
    * @example "HELLO {0} {1}".format("TO", "ALL") il risultato finale sarà "HELLO TO ALL"
    * @returns ritorna l'esito del controllo true|false
    */
    // tslint:disable-block
    (<any>String.prototype).isNullOrEmpty = function (val: any): boolean {
      if (val === undefined || val === null || val.trim() === '') {
        return true;
      }
      return false;
    };

    /**
    * @author l.piciollo
    * estenzione delle string native per l'aggiunta di nuove funzionalità
    * si occupa di inietare la funzionalità mancante in IE o Opera per
    * @returns true|false
    */
    // tslint:disable-block
    (<any>String.prototype).includes = function (value): boolean {
      var returnValue = false;
      if (this.indexOf(value) !== -1) {
        returnValue = true;
      }
      return returnValue;
    };
    /**
    * @author l.piciollo
    * funzione di utilita sulle URL in formato stringa, troca la url in caso non abbia parametri in query string
    * utile per la cache o analisi di statistica per chiamate al percorso
    * @returns string
    */
    (<any>String.prototype).truncateUrlIfNoParams = function (val: any): string {
      if (!val || val == "")
        return this.substring(0, this.indexOf("?"));
      return this;
    };
    /**
    * @author l.piciollo
    * funzione di utilita sulle URL in formato stringa, si occupa di eliminare parte del testo, ad esempio il tag che indica se *  meno una url è storable
    * @returns string
    */
    (<any>String.prototype).truncateUrlCache = function (cachableTag: string): string {
      if (this.indexOf(cachableTag) > -1)
        return this.replace(cachableTag, '');
      return this;
    };

    /**
     * @author l.piciollo
     * funzionalità utile pe ripetere la stringa per un numero di volte stabilito nel parametro
     * @example "HELLO ".repeat(5) il risultato finale sarà "HELLO HELLO HELLO HELLO HELLO "
     * @returns string
     */
    (<any>String.prototype).repeat = function (length) {
      return Array(length + 1).join(this);
    };

    /********************************************************************************************************* */
    /**
     * @author l.piciollo
     * funzione per cambiare il valore di un json, l'esecuzione avrà impatto su tutte le chiavi dei json anche annidati
     * che presentano il valore da cambiare
     * @param previousValue  : valore da ricercare e sostituire
     * @param nextValue  : valore da sostituire
     */

    JSON["changeValues"] = function (json, previousValue, nextValue) {
      let recursive = function (json, previousValue, nextValue) {
        let k = "";
        if (json instanceof Object) {
          for (k in json) {
            if (json.hasOwnProperty(k)) {
              recursive(json[k], previousValue, nextValue);
              if (json[k] === previousValue) {
                json[k] = nextValue
              }
            }
          }
        }
      }
      recursive(json, previousValue, nextValue);
      return json
    };
    /********************************************************************************************************* */

    /**
     * @author l.piciollo
     * funzione per cambiare il valore di un json, l'esecuzione avrà impatto su tutte le chiavi dei json anche annidati
     * che presentano il valore da cambiare
     * @param key  :  chiave da sostituire
     * @param nextValue  : valore da sostituire
     */
    JSON["changeValuesByKey"] = function (json, key, nextValue) {
      let recursive = function (json, previousValue, nextValue) {
        let k = "";
        if (json instanceof Object) {
          for (k in json) {
            if (json.hasOwnProperty(k)) {
              recursive(json[k], previousValue, nextValue);
              if (k === key) {
                json[k] = nextValue
              }
            }
          }
        }

      }
      recursive(json, key, nextValue);
      return json
    }

    /********************************************************************************************************* */
    /**
     * @author l.piciollo
     * funzione per ricercare tutte le chiavi di un oggetto che hanno un determinato valore    
     * @param value  : valore da ricercare
     * @returns Observable function
     */
    JSON["findByValue"] = function (json, value): Array<any> {
      let keys = [];
      let recursive = function (object, value, key, obj) {
        let k = "";
        if (object instanceof Object) {
          for (k in object) {
            if (object.hasOwnProperty(k)) {
              recursive(object[k], value, key + "." + k, object);
            }
          }
        } else {
          if (object === value) {
            keys.push({ key: key.substring(1, key.length), value: object, object: obj });
          }
        }
      }
      recursive(json, value, "", json);
      return keys
    }

    /********************************************************************************************************* */
    /**
     * @author l.piciollo
     * funzione per ricercare tutte le chiavi di un oggetto che hanno un determinato valore    
     * @param value  : valore da ricercare
     * @returns Observable function
     */
    JSON["findKey"] = function (json, keyFind): Array<any> {
      let keys = [];
      let recursive = function (object, value, key) {
        let k = "";
        if (object instanceof Object) {
          for (k in object) {
            if (object.hasOwnProperty(k)) {
              recursive(object[k], value, k);
            }
          }
        }
        if (key === keyFind) {
          keys.push({ "key": key, value: object });
        }
      }
      recursive(json, keyFind, "");
      return keys
    }

    /**
      * @l.piciollo
      * scanner per json, ritorna all'osservatore la flatkey con il valore associato.
      * @param obj 
      */
    JSON["json2flat"] = function (json): Array<any> {
      let keys = [];
      let recursive = function (object, key) {
        let k = "";
        if (object instanceof Object) {
          for (k in object) {
            if (object.hasOwnProperty(k)) {
              recursive(object[k], key + "." + k);
            }
          }
        } else {
          keys.push({ key: key.substring(1, key.length), value: object });
        }
      }
      recursive(json, "");
      return keys;
    };

    /**
     * @author l.piciollo
     * ritorna sottoforma di array key value tutte le chiavi del json 
     */
    JSON["json2array"] = function (json): Array<any> {
      let keys = [];
      let recursive = function (object, key) {
        let k = "";
        if (object instanceof Object) {
          for (k in object) {
            if (object.hasOwnProperty(k)) {
              recursive(object[k], k);
            }
          }
        } else {
          keys.push({ key: key, value: object });
        }
      }
      recursive(json, "");
      return keys;
    };


    /**
      * @l.piciollo
      * scanner per json, ritorna all'osservatore la flatkey con il valore associato in formato JSON.
      * @param obj 
      */
    JSON["json2flatObj"] = function (data): JSON {
      var result = {};
      function recurse(cur, prop) {
        if (Object(cur) !== cur) {
          result[prop] = cur;
        } else if (Array.isArray(cur)) {
          for (var i = 0, l = cur.length; i < l; i++)
            recurse(cur[i], prop + "[" + i + "]");
          if (l == 0)
            result[prop] = [];
        } else {
          var isEmpty = true;
          for (var p in cur) {
            isEmpty = false;
            recurse(cur[p], prop ? prop + "." + p : p);
          }
          if (isEmpty && prop)
            result[prop] = {};
        }
      }
      recurse(data, "");
      return <JSON>result;
    }
  }
  /**
   * @author l.piciollo
   * Identifica il brawser in uso
   */
  public browserIdentify(): BROWSER {
    try {
      var test = function (regexp) { return regexp.test(window.navigator.userAgent); }
      switch (true) {
        case test(/edge/i): return BROWSER.EDGE;
        case test(/opr/i) && (!!window.opr || !!window.opera): return BROWSER.OPERA;
        case test(/chrome/i) && !!window.chrome: return BROWSER.CHROME;
        case test(/trident/i): return BROWSER.IE;
        case test(/firefox/i): return BROWSER.FIREFOX;
        case test(/safari/i): return BROWSER.SAFARI;
        default: return BROWSER.OTHER;
      }
    } catch (e) {
      throw e
    };
  }
  /****************************************************************************************** */
  /** @ignore */
  private createLinkBlob(streamData: ArrayBuffer, nomeFile: string, isTextfile: boolean = true): Promise<Array<any>> {
    return new Promise((resolve, reject) => {
      try {
        let jsEscape = "\uFEFF"; /**per il formato csv con accenti..*/
        let blob = null;
        isTextfile ? blob = new Blob([jsEscape + streamData]) : blob = new Blob([streamData]);
        let link = document.createElement('a');
        link.href = window.URL.createObjectURL(blob);
        link.download = nomeFile;
        resolve([link, blob]);
      } catch (error) {
        reject(error);
      }
    });
  }
  /****************************************************************************************** */
  /**@ignore */
  private destroiLinkBlob(link): Promise<any> {
    return new Promise((resolve, reject) => {
      try {
        URL.revokeObjectURL(link.href);
        link.remove();
        resolve(true);
      } catch (error) {
        reject(error);
      }
    });
  }
  /****************************************************************************************** */
  /**@ignore */
  private noMicro(link): Promise<any> {
    return new Promise((resolve, reject) => {
      try {
        link.click();
        resolve(link);
      } catch (error) {
        reject(error);
      }
    });
  }
  /****************************************************************************************** */
  /** @ignore */
  private micro(obj, nomeFile): Promise<any> {
    return new Promise((resolve, reject) => {
      try {
        if (window.navigator && window.navigator.msSaveOrOpenBlob) {
          window.navigator.msSaveOrOpenBlob(obj[1], nomeFile);
          resolve(obj);
        }
      } catch (error) {
        reject(error);
      }
    });
  }
  /****************************************************************************************** */
  /** @ignore */
  private getFileName(headers: HttpHeaders, fileName?: string): string {
    try {
      if (fileName) { headers = headers.set("content-disposition", "inline; filename=" + fileName); }
      return (headers.get('content-disposition').split(';')[1].split('filename')[1].split('=')[1].trim()).replace(/"/g, '');
    } catch (e) {
      throw new Error("content-disposition or filename is required...")
    }
  }
  /****************************************************************************************** */
  /** @ignore */
  private isTextfile(headers: HttpHeaders): boolean {
    let text = (String(headers.get('content-type')).toLowerCase().indexOf("json") > -1 || String(headers.get('content-type')).toLowerCase().indexOf("text") > -1)
    return text;
  }
  /****************************************************************************************** */
  /** @ignore */
  private downloadFile(streamData: ArrayBuffer, contentType: CONTENT_TYPE | string = CONTENT_TYPE.JSON, fileNamed?: string): Promise<any> {
    return new Promise((resolve, reject) => {
      let headers = new HttpHeaders();
      headers = headers.set('content-type', contentType);
      let fileName = this.getFileName(headers, fileNamed);
      let isTextfile = this.isTextfile(headers);
      this.createLinkBlob(streamData, fileName, isTextfile).then(obj => {
        if (/msie\s|trident\/|edge\//i.test(window.navigator.userAgent)) {
          this.micro(obj, fileName).then(obj => {
            this.destroiLinkBlob(obj[0]).then(() => { });
            resolve("OK");
          });
        } else {
          this.noMicro(obj[0]).then(link => {
            this.destroiLinkBlob(link).then(() => {
              resolve("OK");
            });
          });
        }
      }).catch(error => {
        reject(error);
      });
    });
  }
  /****************************************************************************************** */
  /** @ignore */
  private downloadFileOver() {
    try {
      this.httpService.DOWNLOAD = this.downloadFile.bind(this);
    } catch (error) {
      throw error;
    }
  }



  /****************************************************************************************** */
  /** @ignore */
  private disableConsole() {
    (<any>window).console = ((oldCons) => {
      return {
        log: (text) => { },
        info: (text) => { },
        warn: (text) => { },
        debug: (text) => { },
        error: (text) => { }
      };
    })(window.console);
  }

}
